import React from 'react';
import './App.css';
import {Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
     <Header />
      <Route exact path='/' component={()=><Home name="prabhakar"/>}/>
      <Route path='/About'  component={About} />
      <Route path='/Contact' component={Contact}/>
    </div>
  );
}

export default App;
